import React from 'react';
import styled from 'styled-components';
import iconImage from './globe.svg'; // Update this with your icon image path

const AppContainer = styled.div`
  text-align: center;
`;

const AppHeader = styled.header`
  background: rgba(25, 98, 185, 1);
  height: 97px;
  position: relative;
`;

const Main = styled.main`
  background: rgba(165, 198, 237, 1);
  flex-grow: 1;
`;

const Icon = styled.img`
  width: 81px;
  position: absolute;
  top: 0;
  left: 0;
`;

function App() {
  return (
    <AppContainer>
        <AppHeader>
          <Icon src={iconImage} alt="Icon" />
        </AppHeader>
        <Main>

        </Main>
    </AppContainer>
  );
}

const Container = styled.div`
  display: flex;
  flex-direction: column;
  min-height: 100vh;
`;

const Header = styled.header`
  background: rgba(25, 98, 185, 1);
  height: 97px;
`;



const CommonTemplate = ({ children }) => {
  return (
    <Container>
      <Header>
        {/* Your header content goes here */}
      </Header>
      <Main>
        {children}
      </Main>
    </Container>
  );
};

export default App;
